import React, {Component} from 'react';
import ListaBlocoConteudo from '../../components/Competencias/ListaBlocoConteudo';
import { competenciasTecnicasData } from '../../Configs/competenciasData';
import './Home.css';

class Home extends Component{
    render(){
        return (
            <div className="home">
                <ListaBlocoConteudo items={competenciasTecnicasData} />
            </div>
        );
    }
}

export default Home;
